commits.content:
.stars {
  display: flex;
}

.stars__star {
  display: flex;
  width: 16px;
  height: 16px;
  background-repeat: no-repeat;
  background-position: 50%;
}

.stars__star:not(:last-child) {
  justify-content: space-between;
  margin-right: 4px;
}
